import {GET_ALL} from "./types";

export function fetchPosts() {
    console.log("HELO")
    return async dispatch=>{
            const response= await fetch('http://localhost:8081/api/v1/employees')
            const json = await response.json()
            dispatch({type:GET_ALL,payload: json})
        console.log("json")

    }
}
